def isPangram(stringList: list) -> str:

    result = ""
    listLenght = len(stringList)-1

    if listLenght  <=100 and listLenght <=1:
        for string in stringList:
            if 1<= len(string) and len(string)<=10**5:
                num_unique_alphabet = len(set(list(string))) - 1 # minute the space
                if num_unique_alphabet == 26:
                    result += "1"
                else:
                    result += "0"
            else:
                result += "0"
    else:
        return 0

    return result

